import styles from "./heading.module.css";

const Header = () => {
  return (
    <div classname={styles.header}>
      <h1>ReactMeals</h1>
      <div className={styles.yourcart}>
        <p>Your Cart</p>
      </div>
    </div>
  );
};

export default Header;
